import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";

import { BrowserRouter } from 'react-router-dom';


import NavBar from './Components/NavBar';
const App = () => {
  return (
    <>
    <BrowserRouter>
    <div className="nav ">  
        <NavBar/>
    </div>
    </BrowserRouter>

    </>
  )
}

export default App
